(1, 'Wedding Shopping Festival', '1680272354.jpg', '<div dir=\"auto\">Hi</div>\r\n<div dir=\"auto\">Happy to announce that <a class=\"x1i10hfl xjbqb8w x6umtig x1b1mbwd xaqea5y xav7gou x9f619 x1ypdohk xt0psk2 xe8uvvx xdj266r x11i5rnm xat24cr x1mh8g0r xexx8yu x4uap5 x18d9i69 xkhd6sd x16tdsg8 x1hl2dhg xggy1nq x1a2a7pz xt0b8zv x1qq9wsj xo1l8bm\" tabindex=\"0\" role=\"link\" href=\"https://www.facebook.com/Anizorbd?__cft__[0]=AZUYjRlobcHh7bE24EYhg7fTOYHg-XHKB_t5cXmgnZz7uyCLwyfz-LHIbE9vgPj4NDDL5ilPK8kGsHj1AercvD29KQLNyiC26v8IkGRAZb_urgAwNGd2-Ghg1I3wF0X-_ewtW1uT9UcPvjy4-b80e-pMl3r10MJZipDuUyAUIn2qYi-D5AUqOx8nvuYoeX7d4OM&amp;__tn__=-]K-R\"><span class=\"xt0psk2\">Anizor</span></a> is going to participate Wedding Shopping Festival at LakeShore Hotel Gulshan, Dhaka from 13-15 October</div>\r\n<div dir=\"auto\">You all are cordially invited to our stall #20 to enjoy shopping.</div>', NULL, NULL, '2022-12-11 03:13:46', '2023-04-01 03:19:14'),
(2, 'Cotton Panjabi is a tradition.', '1680272243.png', '<p>Cotton Panjabi is a traditional garment worn by men in the South Asian region, particularly in Bangladesh and parts of India. The Panjabi is a loose, comfortable shirt-like garment that is typically worn with a pair of loose-fitting trousers known as pajamas. The Panjabi is often made of lightweight cotton material that is cool and breathable, making it ideal for hot and humid weather conditions.</p>\r\n<p>The Cotton Panjabi is a popular choice for many men in South Asia, not only because of its comfortable design but also because of its versatility. It can be worn in a variety of settings, from formal occasions to casual events. The garment is available in a wide range of colors, designs, and patterns, which allows men to express their personal style and preferences.</p>\r\n<p>The Cotton Panjabi is also known for its intricate embroidery and embellishments. Many Panjabis feature beautiful embroidery work around the collar, cuffs, and placket, which adds a touch of elegance and sophistication to the garment. The embroidery is often done by hand, and the designs can be quite intricate and detailed, featuring a range of geometric patterns, floral motifs, and other decorative elements.</p>\r\n<p>In addition to embroidery, some Cotton Panjabis are also decorated with beading, sequins, or other types of embellishments. These embellishments can add a touch of sparkle and shine to the garment, making it ideal for formal occasions such as weddings or religious festivals.</p>\r\n<p>The Cotton Panjabi is a versatile garment that can be worn in a variety of ways. It can be worn tucked in or left untucked, depending on the occasion and personal preference. Some men choose to wear a belt with their Panjabi to give it a more fitted look, while others prefer to leave it loose and flowing for a more relaxed and casual vibe.</p>\r\n<p>In Bangladesh, the Cotton Panjabi is an important part of the national identity. It is often worn during important cultural events, such as weddings, festivals, and religious ceremonies. The garment is seen as a symbol of pride and tradition, and many men choose to wear it as a way of connecting with their cultural roots.</p>\r\n<p>The Cotton Panjabi has also gained popularity outside of South Asia, particularly in the United States, where it is sometimes worn as an alternative to more formal Western-style dress shirts. The garment\'s loose and comfortable design has made it a popular choice for casual occasions, such as picnics or outdoor gatherings.</p>\r\n<p>In conclusion, the Cotton Panjabi is a traditional garment that has been worn by men in South Asia for centuries. Its lightweight cotton material, intricate embroidery, and versatile design have made it a popular choice for men of all ages and backgrounds. Whether worn for formal occasions or casual events, the Cotton Panjabi is a timeless garment that continues to be an important part of the cultural identity of many people in South Asia and beyond.</p>', NULL, NULL, '2022-12-11 03:18:45', '2023-04-01 03:17:23'),
(3, 'Ramadan & Eid', '1680272055.jpg', '<div class=\"x11i5rnm xat24cr x1mh8g0r x1vvkbs xdj266r x126k92a\">\r\n<div dir=\"auto\">&ldquo;হে ঈমানদারগণ! তোমাদের ওপর রোজা ফরজ করা হলো যেভাবে তা ফরজ করা হয়েছিল তোমাদের পূর্ববর্তীদের ওপর। যাতে তোমরা সংযমী হও। (সূরা বাকারা, আয়াত-১৮৩)\"।</div>\r\n</div>\r\n<div class=\"x11i5rnm xat24cr x1mh8g0r x1vvkbs xtlvy1s x126k92a\">\r\n<div dir=\"auto\">মহান আল্লাহ আমাদের সবাইকে সুস্থতার সাথে রমজানের সবগুলো রোজা রাখার তৌফিক দান করুক ও আমাদের রোজা কবুল করুক, আমিন। এই প্রত্যাশায় সবাইকে রমজান মুবারক!</div>\r\n</div>', NULL, NULL, '2022-12-11 03:19:29', '2023-04-01 03:14:15'),
(4, 'Anizor Panjabi Collection for Eid al-Fitr', '1680272767.png', '<p>Cotton Panjabi is a traditional garment worn by men in the South Asian region, particularly in Bangladesh and parts of India. The Panjabi is a loose, comfortable shirt-like garment that is typically worn with a pair of loose-fitting trousers known as pajamas. The Panjabi is often made of lightweight cotton material that is cool and breathable, making it ideal for hot and humid weather conditions.</p>\r\n<p>The Cotton Panjabi is a popular choice for many men in South Asia, not only because of its comfortable design but also because of its versatility. It can be worn in a variety of settings, from formal occasions to casual events. The garment is available in a wide range of colors, designs, and patterns, which allows men to express their personal style and preferences.</p>\r\n<p>The Cotton Panjabi is also known for its intricate embroidery and embellishments. Many Panjabis feature beautiful embroidery work around the collar, cuffs, and placket, which adds a touch of elegance and sophistication to the garment. The embroidery is often done by hand, and the designs can be quite intricate and detailed, featuring a range of geometric patterns, floral motifs, and other decorative elements.</p>\r\n<p>In addition to embroidery, some Cotton Panjabis are also decorated with beading, sequins, or other types of embellishments. These embellishments can add a touch of sparkle and shine to the garment, making it ideal for formal occasions such as weddings or religious festivals.</p>\r\n<p>The Cotton Panjabi is a versatile garment that can be worn in a variety of ways. It can be worn tucked in or left untucked, depending on the occasion and personal preference. Some men choose to wear a belt with their Panjabi to give it a more fitted look, while others prefer to leave it loose and flowing for a more relaxed and casual vibe.</p>\r\n<p>In Bangladesh, the Cotton Panjabi is an important part of the national identity. It is often worn during important cultural events, such as weddings, festivals, and religious ceremonies. The garment is seen as a symbol of pride and tradition, and many men choose to wear it as a way of connecting with their cultural roots.</p>\r\n<p>The Cotton Panjabi has also gained popularity outside of South Asia, particularly in the United States, where it is sometimes worn as an alternative to more formal Western-style dress shirts. The garment\'s loose and comfortable design has made it a popular choice for casual occasions, such as picnics or outdoor gatherings.</p>\r\n<p>In conclusion, the Cotton Panjabi is a traditional garment that has been worn by men in South Asia for centuries. Its lightweight cotton material, intricate embroidery, and versatile design have made it a popular choice for men of all ages and backgrounds. Whether worn for formal occasions or casual events, the Cotton Panjabi is a timeless garment that continues to be an important part of the cultural identity of many people in South Asia and beyond.</p>', NULL, NULL, '2023-04-01 03:24:27', '2023-04-01 03:26:07');
