(1, 'privacy_policy', 'Privacy Policy', '<p>We at Anizorbd value the privacy and security of our customers&rsquo; personal information. This Privacy Policy describes how we collect, use, and share personal information that we collect through our website [Website Name] (the &ldquo;Site&rdquo;) and the services provided through the Site (the &ldquo;Services&rdquo;).</p>\r\n<p>What Information We Collect</p>\r\n<p>We may collect personal information from you such as your name, email address, phone number, shipping and billing address, payment information, and order details. We also collect non-personal information such as your IP address, browser type, and pages visited on our Site.</p>\r\n<p>How We Use Your Information</p>\r\n<p>We use your personal information to provide the Services, process your orders, communicate with you about your orders and account, and send you marketing communications if you have opted-in to receive them. We also use your information to improve the Site and our Services, and to prevent fraud and protect the security of our customers and the Site.</p>\r\n<p>How We Share Your Information</p>\r\n<p>We may share your personal information with third-party service providers who assist us in providing the Services, such as payment processors, shipping companies, and marketing service providers. We also may share your information with law enforcement or other third parties as required by law or to protect our rights, property, or safety or that of others.</p>\r\n<p>Your Choices</p>\r\n<p>You have the right to access and correct your personal information and to request that we delete your personal information. You can also opt-out of receiving marketing communications from us at any time by following the unsubscribe instructions in the communication.</p>\r\n<p>Cookies and Other Tracking Technologies</p>\r\n<p>We use cookies and other tracking technologies to improve your experience on our Site and to provide the Services. You can choose to disable cookies in your browser settings, but this may affect the functionality of the Site.</p>\r\n<p>Security</p>\r\n<p>We take reasonable measures to protect the security of your personal information, including using secure server technology and encryption. However, no data transmission over the internet or electronic storage system can be guaranteed to be 100% secure.</p>\r\n<p>Changes to this Privacy Policy</p>\r\n<p>We may update this Privacy Policy from time to time by posting a new version on our Site. Your continued use of the Site and the Services after any changes to the Privacy Policy constitutes your acceptance of the changes.</p>\r\n<p>Contact Us</p>\r\n<p>If you have any questions or concerns about our Privacy Policy, please contact us.</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2022-11-28 05:25:27', '2023-03-03 20:12:28'),
(2, 'terms_and_condition', 'Terms and Conditions', '<p><strong>Replacements Refunds</strong></p>\r\n<p>All replacement requests must be made within 48 hours of order receipt, by contacting our customer care team at info@anizorbd.com. Once the request has been received and approved, the replacement item(s) will be shipped within 2-7 working days.</p>\r\n<ul>\r\n<li>The product has been damaged during delivery</li>\r\n<li>The product is defective or out of date</li>\r\n<li>The incorrect product was shipped</li>\r\n</ul>\r\n<p><strong>To return items ordered</strong></p>\r\n<ul>\r\n<li>If you return or replace a product, you will be entitled to a product worth the same amount or the same amount of money as you are returning the product.</li>\r\n</ul>\r\n<p><strong>&nbsp;</strong><strong>Get your money back:</strong></p>\r\n<ul>\r\n<li>We need 5-7 business days to refund the money to your account. If you purchase the product at an offer price, your refund/ replacement/ adjustment will be based on that offer price.</li>\r\n<li>Where you use multiple payment methods for products and services, and you return some of the products in your order, refunds will be made in the following order:</li>\r\n</ul>\r\n<ol>\r\n<li>If purchased directly from the outlet &ndash; Cash</li>\r\n<li>If you have purchased online / through Customer Care &ndash; Mobile Banking Portal (Bkash/ Cash)</li>\r\n</ol>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2023-01-06 01:07:50', '2023-04-01 06:27:50'),
(3, 'return_and_refund_policy', 'Return Refund Policy', '<p>At AnizorBD, we strive to provide our customers with high-quality products and excellent customer service. We want you to be completely satisfied with your purchase from our website. However, if you are not satisfied with your purchase, we have a Return Refund Policy in place to help you.</p>\r\n<ol>\r\n<li>Eligibility for Returns and Refunds We accept returns and refunds for products that meet the following criteria:</li>\r\n</ol>\r\n<ul>\r\n<li>The product is in its original condition, unused and undamaged.</li>\r\n<li>The product was purchased directly from our website.</li>\r\n<li>The product is returned within the specified timeframe, which is 7 days from the date of delivery.</li>\r\n</ul>\r\n<ol start=\"2\">\r\n<li>Process for Returns and Refunds To initiate a return or refund, please follow these steps:</li>\r\n</ol>\r\n<ul>\r\n<li>Contact our customer service team within 7 days of receiving the product.</li>\r\n<li>Provide your order number and a description of the issue.</li>\r\n<li>Our customer service team will provide you with a return authorization number and instructions for returning the product.</li>\r\n<li>Return the product in its original packaging, including all accessories and documentation.</li>\r\n<li>Once we receive the returned product, we will inspect it to ensure that it meets the eligibility criteria.</li>\r\n<li>If the product is eligible for a refund, we will process the refund within a reasonable amount of time.</li>\r\n</ul>\r\n<ol start=\"3\">\r\n<li>\r\n<p>Shipping Costs You are responsible for the cost of shipping the product back to us unless the product is defective or damaged. If the product is eligible for a refund, we will refund the cost of the product and any applicable taxes, but not the cost of shipping.</p>\r\n</li>\r\n<li>\r\n<p>Exchanges We do not offer exchanges at this time. If you would like to exchange a product, please follow the return process and place a new order for the desired product.</p>\r\n</li>\r\n<li>\r\n<p>Refund Processing Time Refunds will be processed within a reasonable amount of time after we receive the returned product. The refund will be issued to the original form of payment used for the purchase.</p>\r\n</li>\r\n<li>\r\n<p>Defective or Damaged Products If you receive a defective or damaged product, please contact our customer service team immediately. We will provide you with a return authorization number and instructions for returning the product. We will cover the cost of shipping the product back to us and provide you with a replacement product or a full refund, whichever you prefer.</p>\r\n</li>\r\n<li>\r\n<p>Exceptions We do not accept returns or refunds for the following products:</p>\r\n</li>\r\n</ol>\r\n<ul>\r\n<li>Products that are not in their original condition, used or damaged.</li>\r\n<li>Products that were not purchased directly from our website.</li>\r\n<li>Products that are not returned within the specified timeframe.</li>\r\n</ul>\r\n<p>If you have any questions or concerns about our Return Refund Policy, please contact our customer service team at [insert contact information.</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2023-01-16 10:42:04', '2023-04-01 06:29:36'),
(4, 'support_policy', 'Support Policy', '<p>At AnizorBD, we are committed to providing our customers with the best possible support. Our goal is to help you resolve any issues you may encounter while using our website or our products. We offer various support options to help you get the assistance you need.</p>\r\n<ol>\r\n<li>Support Channels We offer the following support channels:</li>\r\n</ol>\r\n<ul>\r\n<li>Email: You can contact us at [insert email address] for any questions, concerns, or issues.</li>\r\n<li>Phone: You can call us at [insert phone number] during our business hours [insert business hours].</li>\r\n<li>Live Chat: You can chat with us live on our website during our business hours [insert business hours].</li>\r\n</ul>\r\n<ol start=\"2\">\r\n<li>\r\n<p>Response Time We aim to respond to all support requests within 24 hours of receiving them. However, response times may vary depending on the complexity of the issue.</p>\r\n</li>\r\n<li>\r\n<p>Business Hours Our business hours are [insert business hours]. We are closed on weekends and public holidays.</p>\r\n</li>\r\n<li>\r\n<p>Support Scope We offer support for the following:</p>\r\n</li>\r\n</ol>\r\n<ul>\r\n<li>Technical issues related to our website and products.</li>\r\n<li>General questions and inquiries about our website and products.</li>\r\n<li>Issues related to your order, such as shipping or delivery.</li>\r\n</ul>\r\n<p>We do not offer support for the following:</p>\r\n<ul>\r\n<li>Issues related to third-party products or services.</li>\r\n<li>Issues related to hardware or software that is not provided by AnizorBD.</li>\r\n<li>Issues related to misuse or abuse of our website or products.</li>\r\n</ul>\r\n<ol start=\"5\">\r\n<li>\r\n<p>Escalation Process If you are not satisfied with the support provided by our team, you can request to escalate the issue to a manager. The manager will review your case and work with you to find a resolution.</p>\r\n</li>\r\n<li>\r\n<p>Feedback We welcome your feedback on our support services. If you have any suggestions or comments, please let us know by emailing us at [insert email address].</p>\r\n</li>\r\n</ol>\r\n<p>We are committed to providing excellent support to our customers. If you have any questions or concerns about our Support Policy, please contact us at [insert contact information.</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2023-01-16 10:42:42', '2023-04-01 06:31:04');
